import React, {useState} from 'react';
import Home from './pages/Home';
import { Routes, Route, Link } from 'react-router-dom';
import Events from './pages/Events';
import OurTeam from './pages/OurTeam';
import NoPage from './pages/NoPage';
import AppBar from "@mui/material/AppBar";
import IconButton from "@mui/material/IconButton";
import Toolbar from "@mui/material/Toolbar";
import Button from "@mui/material/Button";
import Typography from "@mui/material/Typography";
import AdbIcon from '@mui/icons-material/Adb';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';





export default function Header(){

  const [eventsMenuAnchor, setEventsMenuAnchor] = useState(null);

  const handleEventsMenuOpen = (event) => {
    setEventsMenuAnchor(event.currentTarget);
  };

  const handleEventsMenuClose = () => {
    setEventsMenuAnchor(null);
  };

    return(
        <AppBar style={{ backgroundColor: 'green' }} position="static">
        <Toolbar>
        <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
          >
        </IconButton>

        <AdbIcon sx={{ display: { xs: 'none', md: 'flex' }, mr: 1 }} />


        <Typography variant="h14" 
            component="div" sx={{ flexGrow: 1 }}>
            Ivey Sustainability
          </Typography>
          <Button component={Link} to="/" color="inherit">Home</Button>

          <Button onMouseEnter={handleEventsMenuOpen} onMouseLeave={handleEventsMenuClose} color="inherit">Events</Button>
          {/*<Button component={Link} to="/events" color="inherit">Events</Button>*/}
          <Menu anchorEl={eventsMenuAnchor} open={Boolean(eventsMenuAnchor)} onClose={handleEventsMenuClose} transformOrigin={{ vertical: 'top', horizontal: 'left' }} >
            <MenuItem component={Link} to="/events" onClick={handleEventsMenuClose}>Upcoming</MenuItem>
            <MenuItem component={Link} to="/" onClick={handleEventsMenuClose}>Past</MenuItem>
          </Menu>

          <Button component={Link} to="/ourteam" color="inherit">Our Team</Button>
          <Button component={Link} to="/media" color="inherit">Media</Button>
          <Button component={Link} to="/contact" color="inherit">Contact</Button>

        </Toolbar>
      </AppBar>

    )
}
